Suppose $\sin D = 0.7$ in the diagram below. What is $DE$? [asy]
pair D,E,F;
F = (0,0);
D = (sqrt(51),7);
E = (0,7);
draw(D--E--F--D);
draw(rightanglemark(D,E,F,15));
label("$D$",D,NE);
label("$E$",E,NW);
label("$F$",F,SW);
label("$7$",(E+F)/2,W);
[/asy]

$\overline{BC}$ is parallel to the segment through $A$, and $AB = BC$. What is the number of degrees represented by $x$?

[asy]
draw((0,0)--(10,0));
draw((0,3)--(10,3));
draw((2,3)--(8,0));
draw((2,3)--(4,0));
label("$A$",(2,3),N);
label("$B$",(4,0),S);
label("$C$",(8,0),S);
